import React from 'react';
import './App.css';
import SpaceXList from './Components/SpaceXList'
// const axios = require('axios');



function App() {
  // axios.get("https://api.spacexdata.com/v3/capsules").then(function (response) {
  //   console.log(response);
  // })
  return (
    <div className="App">

    <div class="jumbotron" style="background-color:#53B1E1; padding-bottom: 2px;">
    <script src="https://code.jquery.com/jquery-3.2.1.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.7/umd/popper.min.js" integrity="sha384-UO2eT0CpHqdSJQ6hJty5KVphtPhzWj9WO1clHTMGa3JDZwrnQq4sF86dIHNDz0W1" crossorigin="anonymous"></script>
    <script src="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/js/bootstrap.min.js" integrity="sha384-JjSmVgyd0p3pXB1rRibZUAYoIIy6OrQ6VrjIEaFf/nJGzIxFDsf4x0xIM+B07jRM" crossorigin="anonymous"></script>

    <script src="https://kit.fontawesome.com/2555c1188f.js"></script>
    <link href="https://fonts.googleapis.com/css?family=Shadows+Into+Light&display=swap" rel="stylesheet"></link>
        <h1 class="fancy display-4 text-center">
        <img  style="width:7%; border-radius:50%" src="{% static 'images/spacex-logo.png' %}" alt="can't flex"/>
        SpaceX React Example
        </h1>
        <p class="lead text-center"> Below I access the spaceX API and display relevant data!
                                <br> This cool project shows my ability to play around with API's and display their data! </br>
                                <br> Using React and AJAX </br>
        </p>
        <hr class="my-1">
        <h4 class="lead text-center"> Query SpaceX API!
          <button type="button" class="btn btn-primary">GO!</button>
        </h4>
        </hr>


    </div>

      <SpaceXList/>

    </div>
  );
}

export default App;
